// Custom JavaScript

////////////////////////////////////////////////////////////////////////
// Initialize the map to chosen geographical coordinates and zoom level

var map = L.map('map').setView([7.8, 20], 2);


////////////////////////////////////////////////////////////////////////
// Add tile layer to the map. Following is from Mapbox.

L.tileLayer('https://{s}.tiles.mapbox.com/v3/{id}/{z}/{x}/{y}.png', {
  maxZoom: 18,
  id: 'kms2project.k2pe2fpf'
}).addTo(map);


////////////////////////////////////////////////////////////////////////
// onEachFeature

function onEachFeature(feature, layer) {
   var popupContent = '<h2><!--<a href="//demo1.kmsgh.org/USAID/global-health/tuberculosis/countries/' + feature.properties.url + '">-->' + feature.properties.SOVEREIGNT + '<!--</a>--></h2>'

  layer.on({
    mouseover: highlightFeature,
    mouseout: resetHighlight
  }).bindPopup(popupContent);
}


////////////////////////////////////////////////////////////////////////

function style(feature) {
  return {
    weight: 1,
    opacity: 1,
    color: 'white',
    fillOpacity: 0.5,
    fillColor: '#9e005d'
    // fillColor: '#fa7e00'
  };
}

// Set country colors

function getColor(d) {
	return d == 'priority'  ? '#6F048C' :
		   d == 'globalfund' ? '#31a354' :
		   d == 'both'  ? '#e6550d' :
	'red';
}

// Set map style

function style(feature) {
	return {
		weight: 1,
		opacity: 1,
		color: 'white',
		// dashArray: '3',
		fillOpacity: 0.3,
		fillColor: getColor(feature.properties.countryGroup)
		// fillColor: '#FD8D3C'
	};
}

// Highlight on mouse-over.

function highlightFeature(e) {
  var layer = e.target;
  
  // attempting to var info to stop JSLint error spam; might be due to load order on js files.
  var info;

  layer.setStyle({
    weight: 1,
    color: '#fff',
    dashArray: '',
    fillOpacity: 0.5
  });

  if (!L.Browser.ie && !L.Browser.opera) {
    layer.bringToFront();
  }

  info.update(layer.feature.properties);
}

// Highlight reset

var geojson;

function resetHighlight(e) {
  geojson.resetStyle(e.target);
  info.update();
}


////////////////////////////////////////////////////////////////////////
// GeoJSON layer

geojson = L.geoJson(countryData, {
  style: style,
  onEachFeature: onEachFeature
}).addTo(map);

